// provide pictures, which are static (other pictures are provided in the IFM JavaScript object)
// the picture function is located at the end of the script (PHP Misc - Section)
if(isset($_GET["pic"])) {
	header('Content-type: image/png'); header('Cache-Control: public, store, cache'); echo picture($_GET["pic"]);
	die();
}
// API Switch
// decides if the script should work as an API which returns JSON
if(isset($_POST["api"])) {
	if($_POST["api"] == "getRealpath") {
		if(isset($_POST["dir"]) && $_POST["dir"] != "")
			getRealpath($_POST["dir"]);
		else
			echo json_encode(array("realpath"=>""));
	}
	elseif($_POST["api"] == "getFiles") {
		if(isset($_POST["dir"]) && isPathValid($_POST["dir"]))
			getFiles($_POST["dir"]);
		else
			getFiles("");
	}
	else {
		if(isset($_POST["dir"]) && isPathValid($_POST["dir"])) {
			
			switch($_POST["api"]) {
				case "createDir":createDir($_POST["dir"], $_POST["dirname"]); break;
				case "saveFile": saveFile($_POST); break;
				case "getContent": getContent($_POST); break;
				case "deleteFile": deleteFile($_POST); break;
				case "renameFile": renameFile($_POST); break;
				case "downloadFile": downloadFile($_POST); break;
				case "extractFile": extractFile($_POST); break;
				case "uploadFile": uploadFile($_POST); break;
				case "changePermissions": changePermissions($_POST); break;
				case "zipnload": zipnload($_POST); break;
				case "remoteUpload": remoteUpload($_POST); break;
				default: echo json_encode(array("status"=>"ERROR", "message"=>"No valid api action given")); break;
			}
		} else echo json_encode(array("status"=>"ERROR", "message"=>"No valid working directory"));
	}
	die();
}

/* API Functions: */

// get files
function getFiles($dir) {
	global $config;
	// SECURITY FUNCTION (check that we don't operate on a higher level that the script itself)
	$dir=getValidDir($dir);
	// now we change in our target directory
	chDirIfNecessary($dir);
	// unset our file and directory arrays
	unset($files); unset($dirs); $files = array(); $dirs = array();
	// so lets loop over our directory
	if ($handle = opendir(".")) {
		while (false !== ($result = readdir($handle))) { // this awesome statement is the correct way to loop over a directory :)
			if($result==basename($_SERVER['SCRIPT_NAME']) && getScriptRoot() == getcwd()) { } // we don't want to see the script itself
			elseif(($result==".htaccess" || $result==".htpasswd") && $config["showhtdocs"]!=1) {} // check if we are granted to see .ht-docs
			elseif($result==".") {} // the folder itself will also be invisible
			elseif($result!=".." && substr($result,0,1)=="." && $config["showhiddenfiles"]!=1) {} // eventually hide hidden files, if we should not see them
			else { // thats are the files we should see
				$item = array();
				$i = 0;
				$item["name"] = $result;
				$i++;
				if(is_dir($result)) $item["type"] = "dir";
				else $item["type"] = "file";
				if(is_dir($result))$item["picture"] = "folder.png";
				else {
					$type = substr(strrchr($result, "."),1);
					$item["picture"] = getTypePicture($type);
				}
				if($config["showlastmodified"]==1){ $item["lastmodified"] = date("d.m.Y, G:i e", filemtime($result)); }
				if($config["showfilesize"]==1) {
					$item["filesize"] = filesize($result);
					if($item["filesize"]>1073741824)$item["filesize"]=round(($item["filesize"]/1073741824), 2) . " GB";
					elseif($item["filesize"]>1048576)$item["filesize"]=round(($item["filesize"]/1048576), 2) . " MB";
					elseif($item["filesize"]>1024)$item["filesize"]=round(($item["filesize"]/1024), 2) . " KB";
					else $item["filesize"] = $item["filesize"] . " Byte";
				}
				if($config["showrights"]>0) {
					if($config["showrights"]==1) $item["fileperms"] = substr(decoct(fileperms($result)),-3);
					elseif($config["showrights"]==2) $item["fileperms"] = FilePermsDecode(fileperms($result));
					if($item["fileperms"] == "") $item["fileperms"] = " ";
				}
				if($config["showowner"]==1) {
					if(fileowner($result)!==false) {
						$ownerarr = posix_getpwuid(fileowner($result));
						$item["owner"] = $ownerarr['name'];
					}
					else $item["owner"] = "";
				}
				if($config["showgroup"]==1) {
					if(filegroup($result)!==false) {
						$grouparr = posix_getgrgid(filegroup($result));
						$item["group"] = $grouparr['name'];
					}
					else $item["group"] = "";
				}
				if(is_dir($result))$dirs[] = $item;
				else $files[] = $item;
			}
		}
		closedir($handle);
	}
	usort($dirs, "sortByName");
	usort($files, "sortByName");
	echo json_encode(array_merge($dirs,$files));
}
// creates a directory
function createDir($w, $dn) {
	if($dn == "") echo json_encode(array("status"=>"ERROR", "message"=>"No valid directory name"));
	elseif(strpos($dn, '/') !== false) echo json_encode(array("status"=>"ERROR", "message"=>"No slashes allowed in directory names"));
	else {
		chDirIfNecessary($w);
		if(@mkdir($dn)) {
			echo json_encode(array("status"=>"OK","message"=>"Directory successful created"));
		}
		else 
			echo json_encode(array("status"=>"ERROR", "message"=>"Could not create directory"));
	}
}
// gets the real path of a directory
function getRealpath($dir) {
	if(getScriptRoot() != substr(realpath($_POST["dir"]),0,strlen(getScriptRoot()))) {
		echo json_encode(array("realpath"=>""));
	} else {
		$rp = substr(realpath($_POST["dir"]),strlen(getScriptRoot())+1);
		if($rp == false) $rp = "";
		echo json_encode(array("realpath"=>$rp));
	}
}
// save a file
function saveFile(array $d) {
	global $config;
	if(isset($d['filename']) && $d['filename'] != "") {
		// if you are not allowed to see .ht-docs you can't save one
		if($config["showhtdocs"]!=1 && substr($d['filename'],0,3) == ".ht")
			echo json_encode(array("status"=>"ERROR","message"=>"You are not allowed to edit or create htdocs"));
		// same with hidden files
		elseif($config["showhiddenfiles"] != 1 && substr($d['filename'],0,1) == ".")
			echo json_encode(array("status"=>"ERROR","message"=>"You are not allowed to edit or create hidden files"));
		elseif(strpos($d['filename'],'/')!==false)
			echo json_encode(array("status"=>"ERROR","message"=>"Filenames cannot contain slashes."));
		else {
			if(isset($d['content'])) {
				chDirIfNecessary($d['dir']);
				// work around magic quotes
				$content = get_magic_quotes_gpc()==1?stripslashes($d['content']):$d['content'];
				if(@file_put_contents($d['filename'],$content)!==false) {
					echo json_encode(array("status"=>"OK","message"=>"File successful edited/created"));
				} else echo json_encode(array("status"=>"ERROR","message"=>"Could not write content"));
			} else echo json_encode(array("status"=>"ERROR","message"=>"Got no content"));
		}
	} else echo json_encode(array("status"=>"ERROR","message"=>"No filename specified"));
}
// gets the content of a file
// notice: if the content is not JSON encodable it returns an error
function getContent(array $d) {
	global $config;
	if($config["edit"] != 1) echo json_encode(array("status"=>"ERROR", "message"=>"No permission to edit files"));
	else {
		chDirIfNecessary($d['dir']);
		if(file_exists($d['filename'])) {
			echo json_encode(array("status"=>"OK", "data"=>array("filename"=>$d['filename'], "content"=>htmlspecialchars(@file_get_contents($d['filename']), ENT_QUOTES))));
		} else echo json_encode(array("status"=>"ERROR", "message"=>"File not found"));
	}
}
// deletes a file or a directory (recursive!)
function deleteFile(array $d) {
	global $config;
	if($config["delete"] != 1) echo json_encode(array("status"=>"ERROR", "message"=>"No permission to delete files"));
	else {
		chDirIfNecessary($d['dir']);
		if(is_dir($d['filename'])){
			$res = rec_rmdir($d['filename']);
			if($res != 0) echo json_encode(array("status"=>"ERROR", "message"=>"No permission to delete files"));
			else echo json_encode(array("status"=>"OK", "message"=>"Directoy successful deleted"));
		}
		else{ 
			if(@unlink($d['filename']))
				echo json_encode(array("status"=>"OK", "message"=>"File successful deleted"));
			else echo json_encode(array("status"=>"ERROR", "message"=>"File could not be deleted"));
		}
	}
}
// renames a file
function renameFile(array $d) {
	global $config;
	if($config["rename"] != 1) echo json_encode(array("status"=>"ERROR", "message"=>"No permission to rename files"));
	else {
		chDirIfNecessary($d['dir']);
		if(strpos($d['newname'],'/') !== false) echo json_encode(array("status"=>"ERROR", "message"=>"No slashes allowed in filenames"));
		elseif($config["showhtdocs"] != 1 && (substr($d['newname'], 0, 3) == ".ht" || substr($d['filename'],0,3) == ".ht")) echo json_encode(array("status"=>"ERROR", "message"=>"Not allowed to rename file"));
		elseif($config["showhiddenfiles"] != 1 && (substr($d['newname'], 0, 1) == "." || substr($d['filename'],0,1) == ".")) echo json_encode(array("status"=>"ERROR", "message"=>"Not allowed to rename file"));
		else {
			if(@rename($d['filename'], $d['newname']))
				echo json_encode(array("status"=>"OK", "message"=>"File successful renamed"));
			else
				echo json_encode(array("status"=>"ERROR", "message"=>"File could not be renamed"));
		}
	}
}
// provides a file for downloading
function downloadFile(array $d) {
	global $config;
	if($config["download"] != 1)
		echo json_encode(array("status"=>"ERROR", "message"=>"Not allowed to download files"));
	elseif($config["showhtdocs"] != 1 && (substr($d['filename'], 0, 3) == ".ht" || substr($d['filename'],0,3) == ".ht")) echo json_encode(array("status"=>"ERROR", "message"=>"Not allowed to download htdocs"));
	elseif($config["showhiddenfiles"] != 1 && (substr($d['filename'], 0, 1) == "." || substr($d['filename'],0,1) == ".")) echo json_encode(array("status"=>"ERROR", "message"=>"Not allowed to download hidden files"));
	else {
		chDirIfNecessary($d["dir"]);
		header("Content-Type: application/octet-stream");
		header("Content-Disposition: attachment; filename=\"".$d["filename"]."\"");
		@readfile($d["filename"]);
	}
}
// extracts a zip-archive
function extractFile(array $d) {
	global $config;
	if($config["extract"] != 1) echo json_encode(array("status"=>"ERROR", "message"=>"No permission to extract files"));
	else {
		chDirIfNecessary($d['dir']);
		if(!file_exists($d['filename']) || substr($d['filename'],-4) != ".zip")
			echo json_encode(array("status"=>"ERROR","message"=>"No valid zip file found"));
		else {
			if(!isset($d['targetdir'])) $d['targetdir'] = "";
			if(strpos($d['targetdir'], "/")!== false)
				echo json_encode(array("status"=>"ERROR","message"=>"Target directory must not contain slashes"));
			else {
				switch($d['targetdir']){
					case "": 
						if(unzip($_POST["filename"]))
							echo json_encode(array("status"=>"OK","message"=>"File successfully extracted."));
						else echo json_encode(array("status"=>"ERROR","message"=>"File could not be extracted"));
						break;
					default:
						if(!mkdir($d['targetdir']))
							echo json_encode(array("status"=>"ERROR","message"=>"Could not create target directory"));
						else { 
							chdir($d['targetdir']);
							if(!unzip("../".$d["filename"])) {
								chdir("..");
								rmdir($d['targetdir']);
								echo json_encode(array("status"=>"ERROR","message"=>"Could not extract file"));
							}
							else {
								chdir(".."); echo json_encode(array("status"=>"OK","message"=>"File successfully extracted"));
							}
						}
						break;
				}
			}
		}
	}
}
// uploads a file
function uploadFile(array $d) {
	global $config; global $_FILES;
	if($config["upload"] != 1) echo json_encode(array("status"=>"ERROR", "message"=>"No permission to upload files"));
	elseif(!isset($_FILES['file'])) echo json_encode(array("file"=>$_FILE,"files"=>$_FILES));
	else {
		chDirIfNecessary($d['dir']);
		$newfilename = (isset($d["newfilename"])&&$d["newfilename"]!="") ? $d["newfilename"] : $_FILES['file']['name'];
		if($config["showhtdocs"] != 1 && (substr($newfilename, 0, 3) == ".ht" || substr($newfilename,0,3) == ".ht")) echo json_encode(array("status"=>"ERROR", "message"=>"Not allowed to upload htdoc file"));
		elseif($config["showhiddenfiles"] != 1 && (substr($newfilename, 0, 1) == "." || substr($newfilename,0,1) == ".")) echo json_encode(array("status"=>"ERROR", "message"=>"Not allowed to upload hidden file"));
		else {
			if($_FILES['file']['tmp_name']) {
				if(is_writable(getcwd())) {
					if(move_uploaded_file($_FILES['file']['tmp_name'], $newfilename))
						echo json_encode(array("status"=>"OK", "message"=>"The file ".$_FILES['file']['name']." was uploaded successfully"));
					else echo json_encode(array("status"=>"ERROR", "message"=>"File could not be uploaded"));
				}
				else echo json_encode(array("status"=>"ERROR", "message"=>"File could not be uploaded since it has no permissions to write in this directory"));
			} else json_encode(array("status"=>"ERROR", "message"=>"No file found"));
		}
	}
}
// change permissions of a file
function changePermissions(array $d) {
	global $config;
	if($config["chmod"] != 1) echo json_encode(array("status"=>"ERROR", "message"=>"No rights to change permissions"));
	elseif(!isset($d["chmod"])||$d['chmod']=="") echo json_encode(array("status"=>"ERROR", "message"=>"Could not identify new permissions"));
	elseif(!isPathValid(pathCombine($d['dir'],$d['filename']))) { echo json_encode(array("status"=>"ERROR", "message"=>"Not allowed to change the permissions")); }
	else {
		chDirIfNecessary($d['dir']); $chmod = $d["chmod"]; $cmi = true;
		if(!is_numeric($chmod)) {
			$cmi = false;
			$chmod = str_replace(" ","",$chmod);
			if(strlen($chmod)==9) {
				$cmi = true;
				$arr = array(substr($chmod,0,3),substr($chmod,3,3),substr($chmod,6,3));
				$chtmp = "0";
				foreach($arr as $right) {
					$rtmp = 0;
					if(substr($right,0,1)=="r") $rtmp = $rtmp + 4; elseif(substr($right,0,1)<>"-") $cmi = false;
					if(substr($right,1,1)=="w") $rtmp = $rtmp + 2; elseif(substr($right,1,1)<>"-") $cmi = false;
					if(substr($right,2,1)=="x") $rtmp = $rtmp + 1; elseif(substr($right,2,1)<>"-") $cmi = false;
					$chtmp = $chtmp . $rtmp;
				}
				$chmod = intval($chtmp);
			}
		}
		else $chmod = "0" . $chmod;

		if($cmi) {
			try {
				chmod($d["filename"], (int)octdec($chmod));
				echo json_encode(array("status"=>"OK", "message"=>"Permissions changed successfully"));
			} catch (Exception $e) {
				echo json_encode(array("status"=>"ERROR", "message"=>"Error while changing permissions"));
			}
		}
		else echo json_encode(array("status"=>"ERROR", "message"=>"Could not determine permission format"));
	}
}
// zips a directory and provides it for downloading
// it creates a temporary zip file in the current directory, so it has to be as much space free as the file size is
function zipnload(array $d) {
	global $config;
	if($config["zipnload"] != 1) echo json_encode(array("status"=>"ERROR", "message"=>"No permission to download directories"));
	else {
		chDirIfNecessary($d['dir']);
		if(!file_exists($d['filename'])) echo json_encode(array("status"=>"ERROR", "message"=>"Directory not found"));
		else {
			unset($zip);
			$dfile = uniqid("epfm") . ".zip"; // temporary filename
			$zip = new zip_file($dfile);
			$zip->add_files($d['filename']);
			$zip->create_archive();
			header("Content-Disposition: attachment; filename=\"".$d['filename'].".zip\"");		
			echo file_get_contents($dfile);
			unlink($dfile); // delete temporary file
		}
	}
}
// uploads a file from an other server using the curl extention
function remoteUpload(array $d) {
	global $config;
	if($config["remoteupload"] != 1) echo json_encode(array("status"=>"ERROR", "message"=>"No permission to remote upload files"));
	elseif(checkCurl() == false) echo json_encode(array("status"=>"ERROR", "message"=>"cURL extention not installed. Please install the cURL extention to use remote file upload."));
	else {
		$filename = (isset($d['filename'])&&$d['filename']!="")?$d['filename']:"curl_".uniqid();
		
		chDirIfNecessary($d['dir']);
		$ch = curl_init(); 
		if($ch) {
			if(allowedFileName($filename) == false)
				echo json_encode(array("status"=>"ERROR", "message"=>"This filename is not allowed due to the config."));
			elseif(filter_var($d['url'], FILTER_VALIDATE_URL) === false)
				echo json_encode(array("status"=>"ERROR", "message"=>"The passed URL is not valid"));
			else {
				$fp = fopen($filename, "w"); 
				if($fp) {
					if( !curl_setopt($ch, CURLOPT_URL, $d['url']) || !curl_setopt($ch, CURLOPT_FILE, $fp) || !curl_setopt($ch, CURLOPT_HEADER, 0) || !curl_exec($ch) )
						echo json_encode(array("status"=>"ERROR", "message"=>"Failed to set options and execute cURL"));
					else {
						echo json_encode(array("status"=>"OK", "message"=>"File sucessfully uploaded"));
					}
					curl_close($ch); 
					fclose($fp);
				} else echo json_encode(array("status"=>"ERROR", "message"=>"Failed to open file"));
			}
		} else echo json_encode(array("status"=>"ERROR", "message"=>"Failed to init cURL."));
	}
}

