				changeDirectory: function(newdir) {
					$.ajax({
						url: ifm.IFM_SCFN,
						type: "POST",
						data: ({
							api: "getRealpath",
							dir: ifm.pathCombine(ifm.currentDir, newdir)
						}),
						dataType: "json",
						success: function(data){
								ifm.currentDir = data.realpath;
								ifm.refreshFileTable();
								$("#currentDir").val(ifm.currentDir);
							},
						error: function() { showMessage("General error occured: No or broken response", "e"); }
					});
				},
				showFileForm: function () {
					var filename = arguments.length > 0 ? arguments[0] : "newfile.txt";
					var content = arguments.length > 1 ? arguments[1] : "";
					var overlay = '<div class="overlay">\
						<form id="showFile">\
							<fieldset>\
								<label>Filename:</label>\
								<input type="text" name="filename" value="'+filename+'" />\
								<textarea id="content" name="content">'+content+'</textarea>\
								<button onclick="ifm.saveFile();$(\'.overlay\').remove();return false;">Save</button>\
								<button onclick="ifm.saveFile();return false;">Save without closing</button>\
								<button onclick="$(\'.overlay\').remove();return false;">Close</button>';
					if(ifm.config.codemirror == 1) {
						overlay += '<select id="cmLang" size="1">';
						for(var mode in CodeMirror.modes) {
							overlay += '<option ';
							overlay += '>'+mode+'</option>';
						}
						overlay += '</select>';
					}
					overlay += '\
							</fieldset>\
						</form>\
					</div>';
					$(document.body).prepend(overlay);
					$(".overlay").on("remove", function () { cm = null; });
					ifm.bindOverlayClickEvent();
					if(ifm.config.codemirror == 1) {
						ifm.cm = CodeMirror.fromTextArea($("#content")[0], {lineWrapping: true, lineNumbers: true, matchBrackets: true});
						$("#cmLang").val(ifm.cm.getOption("mode"));
						$("#cmLang").change(function(){if(ifm.cm)ifm.cm.setOption("mode", $(this).val());});
						
					}
				},
				createDirForm: function() {
					$(document.body).prepend('<div class="overlay">\
						<form id="createDir">\
							<fieldset>\
								<label>Directoy name:</label>\
								<input type="text" name="dirname" value="" />\
								<button onclick="ifm.createDir();$(\'.overlay\').remove();return false;">Save</button><button onclick="$(\'.overlay\').remove();return false;">Cancel</button>\
							</fieldset>\
						</form>\
					</div>');
