// Returns the script root
function getScriptRoot() {
	return realpath(substr($_SERVER["SCRIPT_FILENAME"],0,strrpos($_SERVER["SCRIPT_FILENAME"],"/")));
}
// change directory if it is necessary
function chDirIfNecessary($d) {
	if(substr(getcwd(),strlen(getScriptRoot())) != getValidDir($d)) {
		chdir($d);
	}
}
// Security function for working directory: returns true or false
function isPathValid($p) {
	if($p == "") return true;
	elseif(getScriptRoot() == substr(realpath($p),0,strlen(getScriptRoot()))) return true;
	return false;
}
// Security function for working directory: returns a valid directory (on error empty string which is valid)
function getValidDir($dir) {
	if(getScriptRoot() != substr(realpath($dir),0,strlen(getScriptRoot()))) return "";
	else return (file_exists(realpath($dir)))?substr(realpath($dir),strlen(getScriptRoot())+1):"";
}
// Combines two parts to a valid path
function pathCombine($a, $b) {
	if($a=="" && $b=="")
		return "";
	else 
		return ltrim(rtrim($a, '/') .'/'. ltrim($b, '/'), '/');
}
// Check if filename is allowed
function allowedFileName($f) {
	global $config;
	if($config["showhtdocs"]!=1 && substr($f,0,3) == ".ht")
		return false;
	elseif($config["showhiddenfiles"] != 1 && substr($f,0,1) == ".")
		return false;
	return true;
}
// Sorting function for file and dir arrays
function sortByName($a, $b) {
	if(strtolower($a['name']) == strtolower($b['name'])) return 0;
	return (strtolower($a['name']) < strtolower($b['name'])) ? -1 : 1;
}
// show permissions human readable
function FilePermsDecode( $perms ) {
	$oct = str_split( strrev( decoct( $perms ) ), 1 );$masks = array( '---', '--x', '-w-', '-wx', 'r--', 'r-x', 'rw-', 'rwx' );
	return(sprintf( '%s %s %s', array_key_exists( $oct[ 2 ], $masks ) ? $masks[ $oct[ 2 ] ] : '###',array_key_exists( $oct[ 1 ], $masks ) ? $masks[ $oct[ 1 ] ] : '###',array_key_exists( $oct[ 0 ], $masks ) ? $masks[ $oct[ 0 ] ] : '###'));
}
